import React from 'react';
import { useNavigate } from 'react-router-dom';

export default function ApplicationDeleteConfirm(props) {
  const { application } = props;
  const navigate = useNavigate();
  const onSubmit = (e) => {
    e.preventDefault();
    fetch(`${process.env.REACT_APP_API_SERVER}application/${application._id}`, {
      method: 'DELETE',
    })
      .then((res) => res.json())
      .then((json) => {
        if (typeof json.msg === 'undefined') {
          navigate(-1);
        } else {
          navigate('dashboard/applications');
        }
      });
  };
  return (
    <form onSubmit={(e) => onSubmit(e)}>
      <h3>
        Do you really want to delete this application?
      </h3>
      <button className="btn-cancel" type="button">Cancel</button>
      <input className="btn-confirm-delete" type="submit" value="Delete" />
    </form>
  );
}
